var Matcher = function(data){
	this.w = data.length;
	this.h = data[0].length;
	this.data = data;
	this.discreteData = { };
};

Matcher.TOLERANCE = 7;

Matcher.RATIO_CHECK = 4;

Matcher.prototype.match = function(){
	var i, d, minD, minIndex, size, newRatio, origRatio, ratio2Ratio, key, w, h, found;
	minD = Infinity;
	origRatio = this.w / this.h;
	if(origRatio > 10){
		return {symbol:Matcher.HLINE, d:0};
	}
	minIndex = Infinity;
	for(i = 0; i <= Matcher.KEYS.length-1; i++){
		key = Matcher.KEYS[i];
		w = key.data.length;
		if(w>=1){
			h = key.data[0].length;
			newRatio = w / h;
			ratio2Ratio = newRatio / origRatio;
			if(ratio2Ratio < Matcher.RATIO_CHECK && ratio2Ratio > (1/Matcher.RATIO_CHECK) ){
				d = this.getDistance(this.getDiscreteData(w, h), key.data);
				if(d < minD){
					minD = d;
					minIndex = i;
				}
			}
		}
	}
	if(minIndex <= Matcher.KEYS.length-1){
		found = {symbol:Matcher.KEYS[minIndex].symbol, d:minD};
	}
	else{
		found = {symbol:Matcher.UNKNOWN, d:Infinity};
	}
	console.log("FOUND "+JSON.stringify(found));
	return found;
};

Matcher.prototype.getDiscreteData = function(w, h){
	var lookup = this.discreteData[w+"x"+h];
	if(!lookup){
		lookup = this.discretizeSize(w, h);
		this.discreteData[w+"x"+h] = lookup;
	}
	return lookup;
};

Matcher.prototype.discretizeSize = function(dw, dh){
	var i, j, r;
	r = [ ];
	for(i = 0; i <= dw - 1; i++){
		r[i] = [ ];
		for(j = 0; j <= dh - 1; j++){
			r[i][j] = this.getDiscretePoint(i, j, dw, dh);
		}
	}
	return r;
};	

Matcher.prototype.getDistance = function(data0, data1){
	var w = data0.length;
	var h = data0[0].length;
	var i, j, e, d2 = 0, p0, p1;
	for(i0 = 0; i0 <= w - 1; i0++){
		for(j0 = 0; j0 <= h - 1; j0++){
			for(i1 = 0; i1 <= w - 1; i1++){
				for(j1 = 0; j1 <= h - 1; j1++){
					p00 = data0[i0][j0];
					p01 = data0[i1][j1];
					p10 = data1[i0][j0];
					p11 = data1[i1][j1];
					e = (i0 - i1)*(i0 - i1) + (j0 - j1)*(j0 - j1);
					d2 += Math.exp(-0.5*e)*(p00 - p10)*(p01 - p11);
				}
			}
		}
	}
	d2 = d2 / (2*3.14159);
	//Utils.logImage(data0, data1, d2);
	return d2;
};

Matcher.prototype.getDiscretePoint = function(i, j, dw, dh){
	var x, y, w, h;
	x = this.w * (i/dw);
	y = this.h * (j/dh);
	w = this.w / dw;
	h = this.h / dh;
	return this.getArea( {x:x, y:y, w:w, h:h} );
};

Matcher.prototype.getArea = function(rect){
	var i, j, r, a = 0;
	for(i = 0; i <= this.w - 1; i++){
		for(j = 0; j <= this.h - 1; j++){
			if(this.data[i][j]){
				r = {x:i, y:j, w:1, h:1};
				a += this.getOverlapArea(r, rect);
			}
		}
	}
	return a/(rect.w * rect.h);
};

Matcher.prototype.getOverlapArea = function(r1, r2){
	var r3, r4, overlap, dx, dy;
	r3 = {left:r1.x, right:r1.x + r1.w, top: r1.y + r1.h, bottom: r1.y};
	r4 = {left:r2.x, right:r2.x + r2.w, top: r2.y + r2.h, bottom: r2.y};
	overlap = {};
	overlap.left = Math.max(r3.left, r4.left);
	overlap.right = Math.min(r3.right, r4.right);
	overlap.top = Math.min(r3.top, r4.top);
	overlap.bottom = Math.max(r3.bottom, r4.bottom);
	dx = overlap.right - overlap.left;
	dy = overlap.top - overlap.bottom;
	if(dx > 0 && dy > 0){
		return (dx * dy);
	}
	return 0;
};


